import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Match = () => {
  const [dogMatch, setDogMatch] = useState(null);
  const [dogIds, setDogIds] = useState([]);

  useEffect(() => {
    const fetchMatch = async () => {
      try {
        const response = await axios.post(
          `https://frontend-take-home-service.fetch.com/dogs/match`,
          dogIds,
          {
            withCredentials: true,
            headers: {
              'fetch-api-key':'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s',
            },
          }
        );
        setDogMatch(response.data.match);
      } catch (error) {
        console.error(error);
      }
    };
    if (dogIds.length > 0) {
      fetchMatch();
    }
  }, [dogIds]);

  const handleMatch = async () => {
    try {
      const response = await axios.get(
        `https://frontend-take-home-service.fetch.com/dogs/search`,
        {
          withCredentials:true,
          headers: {
            'fetch-api-key':'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s',
          },
          params: {
            breeds: [],
            size: 10,
          }
        }
      );
      setDogIds(response.data.resultIds);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <button onClick={handleMatch}>Generate Match</button>
      {dogMatch && (
        <div>
          <h3>Your Match</h3>
          <img src={dogMatch.img} alt={dogMatch.name} />
          <p>Name: {dogMatch.name}</p>
          <p>Breed: {dogMatch.breed}</p>
          <p>Age: {dogMatch.age}</p>
          <p>Zip Code: {dogMatch.zip_code}</p>
        </div>
      )}
    </div>
  );
};

export default Match;
